import logo from './logo.svg';
import './App.css';
import {Routes , Route} from 'react-router-dom';
import Home from './Components/Home'
function App() {
  return (
    <div className="App">
      <Routes >
        <Route>
          path = '/' element ={<Home />}
        </Route>
      </Routes>
    </div>
  );
}

export default App;
